import Link from "next/link";

const Navbar = () => (
  <div>
    <ul>
      <li>
        <Link href="/">Home</Link>
      </li>
      <li>
        <Link style={{ color: "white" }} href="/about">
          About
        </Link>
      </li>
    </ul>

    <style jsx>{`
      ul {
        background: #333;
      }

      ul li {
        font-size: 18px;
        color: white;
      }

      Link {
        color: white;
      }
    `}</style>
  </div>
);

export default Navbar;
